import React from "react";

export default function Header() {
  const handleClick = () => {
    sessionStorage.clear();
    console.log("click");
  };

  return (
    <div>
      <div className="callout primary" id="Header">
        <div className="row column">
          <button onClick={handleClick}>Logout</button>
        </div>
      </div>
    </div>
  );
}
